import React, { Component } from "react";

export class Posts extends Component {
    constructor(props) {
        super(props);

        this.state = {
            posts: [],
            DataIsLoaded: false,
        };
    }

    render() {
        return <div>Posts</div>;
    }
}

export default Posts;
